INSERT INTO `block_content__body` VALUES ('basic',0,1,1,'en',0,'<p>Duis egestas convallis elit sit amet tempus. Morbi arcu arcu, commodo sit amet vehicula nec, aliquam ac tellus. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.</p>\r\n','','basic_html'),('basic',0,2,2,'en',0,'<p>Created by <a href=\"http://www.morethanthemes.com\">More than Themes</a>.&nbsp;</p>\r\n','','basic_html'),('basic',0,3,3,'en',0,'Follow us on <a href=\"https://www.facebook.com/morethan.just.themes/\">Facebook</a> | <a href=\"http://twitter.com/morethanthemes\">Twitter</a>&nbsp;\r\n','','basic_html'),('basic',0,4,4,'en',0,'<img alt=\"Banner\" data-align=\"center\" data-entity-type=\"file\" data-entity-uuid=\"bb15d112-bc4b-4e96-985a-909c234d45d3\" src=\"http://mttprojects.s3.amazonaws.com/demo.drupalizing.com/newsplus_lite/240x400-banner.png\" />','','full_html'),('basic',0,5,5,'en',0,'<img alt=\"This is a 300x250 px banner\" data-align=\"center\" data-entity-type=\"file\" data-entity-uuid=\"f0cdc360-05a0-44f9-b200-c7121a2871a5\" src=\"http://mttprojects.s3.amazonaws.com/demo.drupalizing.com/newsplus_lite/300x250-banner.png\" />','','full_html'),('basic',0,6,6,'en',0,'<img alt=\"Header banner 468x60\" data-align=\"center\" data-entity-type=\"file\" data-entity-uuid=\"330ed463-a9ac-47b6-ac00-fa6291e3a4e7\" src=\"http://mttprojects.s3.amazonaws.com/demo.drupalizing.com/newsplus_lite/468x60-banner.png\" />','','full_html'),('basic',0,7,7,'en',0,'<h3>WITH A RICH FOOTER</h3>\r\n\r\n<p>News+ Lite comes with a wealth of regions and classes, providing, among others, a rich multi-level footer where you can place lots of information about your site.</p>\r\n\r\n<p>Therefore, the important pages of your site, can always be just one click away for your visitor, regardless where in your site they are navigating.</p>\r\n','','full_html'),('basic',0,8,8,'en',0,'<h3>CREDITS</h3>\r\n\r\n<p>News+ Lite is the free version of the News+ premium theme, by&nbsp;<a href=\"http://www.morethanthemes.com/&amp;mt-referral=scholarlylite\">More than Themes</a>. It is designed to power your responsive news/portal site.&nbsp;</p>\r\n\r\n<p>News+ Lite is provided for everyone in the Drupal community to use and enjoy. You can use it for your personal or commercial projects, without any limitation. Although attribution is very much appreciated, it is not required.</p>\r\n','','basic_html'),('basic',0,9,9,'en',0,'<h3>HTML5 and CSS3</h3>\r\n\r\n<p>News+ Lite comes with a state-of-the-art code base, using HTML5 and CSS3, compliant with best practices and avoiding hacks and workarounds that could break things along the way.</p>\r\n','','basic_html'),('basic',0,10,10,'en',0,'<h3>Breaking News</h3>\r\n\r\n<p>Synergistically deploy vertical manufactured products with granular relationships. Holisticly network market-driven communities vis-a-vis interdependent schemas. Dynamically incentivize low-risk high-yield materials through virtual portals. Seamlessly scale.</p>\r\n<a href=\"/node/2\">Read more »</a>','','full_html'),('basic',0,11,11,'en',0,'<p class=\"text-right\"><a href=\"http://twitter.com/home?status=Check out the free News+ Lite theme for Drupal8 from @morethanthemes\">Let the world know about News+ Lite</a></p>\r\n','','full_html');
