ffort to bring top quality themes to the Drupal community.&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>You can use News+ Lite without any limitations for your personal or commercial projects. Although attribution is very much appreciated, it is not required.</p>\r\n\r\n<h4>Support &amp; Contact us</h4>\r\n\r\n<p>In addition to our Premium Drupal products, at More than (just) Themes we will continue to release, maintain, improve and enrich our free themes with new features.&nbsp;</p>\r\n\r\n<p>Members of our team participate actively and help out in support requests to the maximum extent possible. Nevertheless, sometimes there might be needs related to a theme that go beyond the typical support and knowledge sharing and require either premium support or even implementation-on-request. In all such cases, do not hesitate to <a href=\"http://www.morethanthemes.com/&amp;mt-referral=scholarlylite\" target=\"_blank\">get in touch with us</a> :)</p>\r\n','','full_html');
